CREATE TABLE `#__acymailing_userstats` (   `mailid` mediumint(8) unsigned NOT NULL,   `subid` int(10) unsigned NOT NULL,   `html` tinyint(3) unsigned NOT NULL DEFAULT '1',   `sent` tinyint(3) unsigned NOT NULL DEFAULT '1',   `senddate` int(10) unsigned NOT NULL,   `open` tinyint(3) unsigned NOT NULL DEFAULT '0',   `opendate` int(11) NOT NULL,   `bounce` tinyint(4) NOT NULL DEFAULT '0',   `fail` tinyint(4) NOT NULL DEFAULT '0',   `ip` varchar(100) DEFAULT NULL,   `browser` varchar(255) DEFAULT NULL,   `browser_version` tinyint(3) unsigned DEFAULT NULL,   `is_mobile` tinyint(3) unsigned DEFAULT NULL,   `mobile_os` varchar(255) DEFAULT NULL,   `user_agent` varchar(255) DEFAULT NULL,   `bouncerule` varchar(255) DEFAULT NULL,   PRIMARY KEY (`mailid`,`subid`),   KEY `senddateindex` (`senddate`),   KEY `subidindex` (`subid`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `#__ak_profiles` (   `id` int(10) unsigned NOT NULL AUTO_INCREMENT,   `description` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,   `configuration` longtext COLLATE utf8mb4_unicode_ci,   `filters` longtext COLLATE utf8mb4_unicode_ci,   `quickicon` tinyint(3) NOT NULL DEFAULT '1',   PRIMARY KEY (`id`) ) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
